// SPDX-License-Identifier: MIT
pragma solidity ^0.8.16;
import { ERC1155 } from '@openzeppelin/contracts/token/ERC1155/ERC1155.sol';
import { ERC1155Supply } from '@openzeppelin/contracts/token/ERC1155/extensions/ERC1155Supply.sol';
import { ERC1155Burnable } from '@openzeppelin/contracts/token/ERC1155/extensions/ERC1155Burnable.sol';
import { Strings } from '@openzeppelin/contracts/utils/Strings.sol';
import { Base64 } from '@openzeppelin/contracts/utils/Base64.sol';

contract TestMultiToken is ERC1155, ERC1155Burnable, ERC1155Supply {
	using Strings for uint256;

	event Minted(address indexed account, uint256 indexed id, uint256 amount);

	event Burned(address indexed account, uint256 indexed id, uint256 amount);

	constructor() ERC1155('') {
	}

  function _beforeTokenTransfer(address operator, address from, address to, uint256[] memory ids, uint256[] memory amounts, bytes memory data) internal override (ERC1155, ERC1155Supply) {
    super._beforeTokenTransfer(operator, from, to, ids, amounts, data);
  }

  function mint(uint256 id, bytes memory data) public payable {
    _mint(msg.sender, id, 1, data);
    emit Minted(msg.sender, id, 1);
  }

	function burn(uint256 id, uint256 amount) public {
		ERC1155Burnable.burn(msg.sender, id, amount);
		emit Burned(msg.sender, id, amount);
	}

	/// @notice Returns a token metadata, compliant with ERC1155Metadata_URI
	/// @param id Token id
	/// @return metadata Token metadata, as json string base64 encoded
	function uri(uint256 id) public view override returns (string memory) {
		require(exists(id), 'Invalid id');
		bytes memory json = abi.encodePacked(
			'{'
				'"name":"Token #', id.toString(), '",'
				'"description":"This is a test token",'
				'"image":"data:image/svg+xml;base64,',
					Base64.encode(
						abi.encodePacked(
							"<svg xmlns='http://www.w3.org/2000/svg' version='1.1' width='400' height='400' viewBox='0 0 1 1'>"
							"<defs>"
								"<linearGradient id='G' x1='0' x2='0' y1='0' y2='1'>"
									"<stop offset='0%' stop-color='red'/>"
									"<stop offset='50%' stop-color='green'/>"
									"<stop offset='100%' stop-color='blue'/>"
								"</linearGradient>"
							"</defs>"
							"<style>"
								".B{fill:#000000}"
								".T{font-family:monospace;font-size:0.025em;fill:#ffffff}"
							"</style>"
							"<rect fill='url(#G)' width='1' height='1' shape-rendering='crispEdges'/>"
							"<text class='T' id='entry' x='50%' y='50%' dominant-baseline='middle' text-anchor='middle'>", id.toString(), "</text>"
							"</svg>"
						)
					),
				'"'
			'}'
		);
		return string(abi.encodePacked('data:application/json;base64,', Base64.encode(json)));
	}
}

